 to click the "+Add File" button so that I can upload a bulk of files ranging from ~2-5GB.\n\nREQ04 - UR04. As a Candidate/Applicant, I want to click the "Search" button so that I can see the listed resulted files.\n\nREQ04 - UR05. As a Candidate/Applicant, I want to click the "Filter" button and filter files according to their category namely Qualification, File Type and Mapped/Unit so that I can see the listed filtered files.\n\nREQ04 - UR06. As a Candidate/Applicant, I want to click the "SORT" button  and sort the files by Date added, newest first, Date added oldest first, Filename A-Z, Filename Z-A, File Size largest first, File Size smallest first and File Type so that I can group/organize them depending on my needs.\n\nREQ04 - UR07. As a Candidate/Applicant, I want to navigate to "Files" tab so that I can see the thumbnails preview of all uploaded files.\n\nREQ04 - UR08. As a Candidate/Applicant using Desktop, I want to send an SMS link to my mobile so that I can take and upload photos or videos over FILES page/tab using mobile.\n\nREQ04 - UR09. As a Candidate/Applicant, I want to navigate to QUALIFICATION and FILES page/tab so that I can to delete unsubmitted evidence\n\nREQ05 - UR01. As a Candidate/Applicant, I want to input my assessment so that I can send it for review.\n\n\n\nREQ06 - UR01. As a Candidate/Applicant, I want to be notified over personal email, click the link and redirected to conversation in RPL when I receive a message from RPL Online so that I can view the entire conversation in a chain - most recent on the top and respond to them granting my session is active.\n\nREQ06 - UR02. As a Candidate/Applicant, I want “TO:” text field to be auto-populated  so that I can message/connect to my assigned facilitator and not other User Type(e.g. Assessor, Admin, Manager, etc..) and initiate a conversation at any given point.\n\n\n\n\nREQ08 - UR01. As a Candidate/Applicant, I want to see QUALIFICATION tab/page correctly loaded so that I can see my facilitator details and statuses of each of my unit based on stages \n\nREQ08 - UR02. As a Candidate/Applicant, I want to see the progression of my status be "Submitted" once I''ve submitted my evidence, "Satisfactory" once facilitator approves it "Competent" once Assessor approves it so that I can execute needed action to progress them\n\nREQ08 - UR03. As a Candidate/Applicant, I want to see statuses such as "Not Yet Satisfactory" and "Not Yet Competent" which means it needs further attention so that I can execute needed action to progress them\n\nREQ08 - UR04. As a Candidate/Applicant, I want to be notified over personal email when statuses of my unit is either "Not Yet Satisfactory" or "Not Yet Competent" so that I can execute needed action to progress them\n\nREQ08 - UR05. As a Candidate/Applicant, I want to see the details of the qualification  along with the core and elective,  how much of the evidence submission is completed and how much is remaining and Facilitator’s details on the dashboard so that I can execute needed action to progress them\n\nREQ08 - UR06. As a Candidate/Applicant, I want to receive a notification over personal email once the facilitator drops a message when the assessor is requesting for a competency conversation where the discussion will be recorded and attached to the unit as evidence so that i can progress and complete my qualification.\n\n\nREQ09 - UR01. As a non - existing Candidate/Applicant, I want to be notified once my account is created through my personal email containing a link which I can click so that I can be directed to ONBOARD page and create my password.\n\nREQ09 - UR02. As a non - existing Candidate/Applicant, I want to see the facilitator contacts me the very first time I logged-in so that I''m well informed and supported as I progress my qualification.\n\nREQ09 - UR03. As an existing Candidate/Applicant, I want to see my new qualification to be attached against my existing account, directed to LOGIN page so that I can progress it to completion.\n\nREQ09 - UR04. As a non-existing Candidate/Applicant, I want a FAQs link which I can click available over ONBOARD page that redirects me to FAQs page so that I’m informed on important topics and concern raised by other candidates as well.\n\nREQ09 - UR05. As a non-existing Candidate/Applicant, I want to see the following text:\n\n     Step 1: Check and complete your details and 100 points of ID\n     Step 2: Choose elective units for your course\n     Step 3: Start uploading your files as evidence of your skills & knowledge\n\n     For more info at anytime, check Frequently Asked Questions\n\nafter I’ve successfully created my password  so that I’m informed on the next step to take.\nREQ10 - UR01. As a non - existing Candidate/Applicant, I want to be directed to Profile Page after create a password over ONBOARD page so that I can validate and complete my Personal Information.\n\nREQ10 - UR02. As an existing Candidate/Applicant, I want to be directed to Profile Page if Personal Information is not completed after login so that I can validate and complete them.\n\nREQ10 - UR03. As an existing Candidate/Applicant, I want to be directed to Qualification Page if Personal Information is  completed after login so that I can continue to progress my qualification.\n\nREQ10 - UR04. As a Candidate/Applicant, I want to upload/update my ID types so that I''ll be able to redeemed the required 100 ID Points until portfolio/qualification is submitted to the assessor.\n\nREQ10 - UR05. As a Candidate/Applicant using Desktop, I want to send an SMS link to my mobile so that I''ll be able to take and upload photos or videos over PROFILE page/tab using mobile.\n\nREQ10 - UR06. As a Candidate/Applicant, I want a FAQs link which I can click available over PROFILE page that redirects me to FAQs page so that I’m informed on important topics and concern raised by other candidates as well.\nREQ11 - UR01. As a Candidate/Applicant, I want to provide my current and new password and click submit button so that I can change it.\n', 1);
INSERT INTO `evidence_text` (`id`, `content`, `self_assessment`) VALUES
(101, ' 0987654321\n13\nDashboard-Day to day work schedule	\n - Assessor dashboard features the following\n    ToDo Items items\n    Unread Messages\n    List of Portfolios sorted based on the age\n    List of recent uploaded evidence\n\nDashboard-Add new Todo items\n - Assessor will be able to add new items to the list from the dashboard\n - ToDo items can be a follow up on email, reviewing evidence uploaded, a portfolio or a free flow text\n - Newly received portfolio, evidence or email should be automatically added to the todo list\n\nDashboard-ToDo list status\n - Each new items will be highlighted enough for get the user attention\n - Each list item carry a date added and a counter will show all those which are delayed\n - Todo list will give motivational messages based on the total queue status to the facilitator\n\nDashboard-Portfolios\n1) Portfolio section show the list of portfolios based on the below criteria\n       a) New Portfolios\n       b) Portfolios which have less number of days remaining\n       c) In progress portfolios\n       d) Those which are above 80% completed (for easy follow up)\n       e) Inactive portfolios for longer period\n2) Each Portfolio items will allow the user to add it to the ToDo list easily\n\nDashboard-Messages\n - Dashboard also gives a quick view into the unread emails received from facilitator\n - Each email thread also give a flexibility to add that to the ToDo list\n\nDashboard-Evidences\n - All the newly uploaded evidences from those portfolios managed by the facilitator will be displayed in the dashboard. \n - Facilitator will be able to make an evidence file upload as ToDo item for follow up/review\n\n\n\n\n\n\n\n\n14\nView the list of applicants available for review\n\nPortfolios-Listing portfolios\n - This page will list all the portfolios which are managed by the logged in assessor\n - Each portfolio will show the remaining days left, evidence completion status etc\n - Facilitator can also add the portfolio to the ToDo list from this screen\n - The list is sorted by default by the number of days left with the portfolio (ascending)\n\nPortfolios-Other features\n - Assessor has got filtering options based on the completion status of the portfolio (current or completed)\n - Search will perform a portfolio search based on the candidate name, qualification name, candidate phone number/email address etc\n\n\n\n\n\n\n15\nPortfolios Details - Detailed view\n - Assessor will be able to see the recent notes on that portfolio in this page\n - Assessor will be making a note on the portfolio after any action is performed.\n - Assessor can also initiate a message conversation with the facilitator from this screen. \n - Every conversation should be tagged with a portfolio. This relation will be used to all the conversation with respect to a portfolio to an assessor\n\n\n\n\n\n\n\n\n16\nReview an applicant\nPortfolios Details - Review Process\n - Each unit will be tagged to represent whether the facilitator have made it ''satisfactory''  for the review\n - Assessor will be able to view the evidences and self assessment submitted by the candidate\n- All the media files should be streamed from the server, where as the documents, pdfs should be opened from the browser ( if supported) otherwise it should get downloaded into the computer and then ready for the review\n\n\n\n\n\n\n17\nReview, approve/disapprove portfolio\nPortfolios Details - Approval process\n- Assessor can view and approve (competent) the evidence from the detailed view after reviewing the evidences\n - Assessor will be asked whether he/she want to send a message on approval/disapproval\n- Assessor will upload a scanned sign of sheet which need to be attached to qualification\n - The message (if any) will be sent to the facilitator as a conversation message and a respective notification will be triggered to the candidate''s personal email address\n\nPlease refer to PORTFOLIO - DETAILED (see REQ15) and REVIEW (see REQ16)  page/tab\n\n\n\n\n18\nStatus of the applicants for which review have already been done by him/her.\nPortfolios Details - Deemed competent\n - When Assessor completes his/her assessment, they can make the candidate ''Deemed competent'' or ''Not Yet competent''\n - Both will trigger a message to the Facilitator and its Facilitator job to  let the candidate know about it\n\nPlease refer to PORTFOLIO - DETAILED page/tab (see REQ15) \n\n\n\n\n\n\n\n19\nStart and upload a Competency Conversation\nPortfolios Details - Competency Conversation\n - As part of assessment, the assessor can invite the candidate for a competency conversion.\n - This will be a video/audio conference systems within the portal\n - When Assessor initiate a request, that will be informed to the facilitator and they inturn notifies the candidate by email or phone\n - The user and assessor will be logging into the platform at a set time and date to complete the competency conversation.\n - Entire conversation should be recorded and at the end of it, attach to the portfolio as another piece of evidence\n\nPlease refer to PORTFOLIO - DETAILED page/tab (see REQ15) \n\n\n\n\n\n\n20\nDownload portfolio\nPortfolios Details - Download Portfolio\n - Assessor also have an option to download the entire portfolio to the local machine from the same screen.\n - Download contains, a zip of all evidences arranged in folder and a pdf page prefilled with candidate information from the application\n\n\n\n\n\n\n\n21\n\nMessaging-Sending\n - Assessor will be able to initiate a conversation with the a facilitator at any given point\n\nMessaging-Receiving\n - Assessor should be notified over office email when they received a communication from the platform\n -  Assessor should be able to click a link in the email and directly land into the conversation in platform\n -  Assessor should be able to view the entire conversation in a chain\n\nPortfolio page/tab\n\n\nEvidence page/tab\n\n\n\n\n\n\n\n\n\n\n22\nProfile-Trainer matrix\n - As part of the profile, every assessor is supposed to enter their trainer matrix which should be available for the RTO for review (if required)\n - Trainer matrix involves, resume, work samples, experiences, certifications etc.\n - A word document template is provided which can be downloaded, filled in and then uploaded back to the profile\n\n\n\n\n\n\n\nFacilitator\n23\nLogin to the system using username/password\n\n\n\n\n\n24\n\nDashboard - Day to day work schedule\n - Facilitator dashboard features the following\n    ToDo Items\n    Unread Messages\n    List of Portfolios sorted based on the age\n    List of recent uploaded evidence\n\nDashboard - Add new Todo items\n - Facilitator will be able to add new items to the list from the dashboard\n - ToDo items can be a follow up on email, reviewing evidence uploaded, a portfolio or a free flow text\n - Newly received portfolio, evidence or email should be automatically added to the todo list\n\nDashboard - ToDo list status\n - Each new item will be highlighted enough for get the user attention\n - Each list item carries a date added and a counter, which will show all those which are delayed\n - Todo list will give motivational messages based on the total queue status to the facilitator\n\nDashboard - Messages\n - Dashboard also gives a quick view into the unread emails received from other users\n - Unread emails are grouped based on the user roles and type of the sender\n - Each email thread also give a flexibility to add that to the ToDo list\n\nDashboard - Portfolios\n - Portfolio section show the list of portfolios based on the below criteria\n       New Portfolios\n       Those which are above 80% completed (for easy follow up)\n       Inactive portfolios for longer period\n - Each Portfolio items will allow the user to add it to the ToDo list easily\n - This section also features a graphical representation of all the portfolios based on the age 0 to 30 days, 31 to 60 days, 60 to 90 days and 90+ days\n\nDashboard - Evidences\n - All the newly uploaded evidences from those portfolios managed by the facilitator will be displayed in the dashboard. \n - Facilitator will be able to make an evidence file upload as ToDo item for follow up/review\n\n\n\n\n\n\n25\nView the list of applicants pending.\nPortfolio - Listing portfolios\n - This page will list all the portfolios which are managed by the logged in facilitator\n - Each portfolio will show the remaining days left, evidence completion status etc\n- Facilitator can also add the portfolio to the ToDo list from this screen\n - The list is sorted by default by the number of days left with the portfolio (ascending)\n\nPortfolio - Other features\n - Facilitator has got filtering options based on the completion status of the portfolio (current or completed)\n - Search will perform a portfolio search based on the candidate name, qualification name, candidate phone number/email address etc.\n\n\n\n\n\n26\n\nPortfolios Details - Detailed view\n - Facilitator will be able to see the recent notes on that portfolio in this page\n- Facilitator will be making a note on the portfolio after any action performed.\n - Facilitator can also initiate a message conversation with the candidate from this screen. \n - Every conversation should be tagged with a portfolio. This relation will be used to all the conversation with respect to a portfolio to an assessor\n\n\n\n\n27\n\nReview the application and compile evidence\n\nPortfolios Details -Review Process\n\n - Each unit will be tagged to represent whether the candidate have ''submitted'' the evidence for the review\n - Facilitator will be able to view the evidences and self assessment submitted by the candidate\n- All the media files should be streamed from the server, where as the documents, pdfs should be opened from the browser ( if supported) otherwise it should get downloaded into the computer and then ready for the review\n\n\n\n\n\n\n28\n\nApproval process\n - Facilitator can view and approve the evidence from the detailed view after reviewing the evidences\n - Facilitator will be asked whether he/she want to send a message on approval/disapproval\n - The message (if any) will be sent to the candidate as a conversation message and a respective notification will be triggered to the candidate''s personal email address\n\n\n\n\n29\n\nUpdate the status\n - Every step of assessment, facilitator need to update the status of the portfolio \n - This status will be updated to the CRM and also notified to the candidate\n\n\n\n\n30\nAssign portfolio to assessor and RTO\n - Once all the units are assessed & satisfactory, facilitator will be able to send the portfolio to the Assessor assigned for this portfolio.\n\n\n\n\n31\nMessaging-Sending\n- The facilitator will be able to initiate a conversation with the a candidate or assessor or RTO at any given point\n\nMessaging-Receiving\n - Facilitator should be notified over office email when they received a communication from the platform\n - Facilitator should be able to click a link in the email and directly land into the conversation in platform\n - Facilitator should be able to view the entire conversation in a chain\n\n\n\n\nRTO\n32\n\nLogin with username/password\n\n\n\n\n\n33\n\nDashboard - Messages\n - Dashboard also gives a quick view into the unread emails received from facilitator\n\nDashboard - Portfolios\n - Portfolio section show the list of portfolios based on the below criteria\n       New Portfolios\n       Portfolios which have less number of days remaining\n       In progress portfolios\n\n\n\n\n\n\n34\n\nView the list of the applicants\nPortfolios - Listing portfolios\n - This page will list all the portfolios which are managed by the logged in RTO Users\n - Each portfolio will show the remaining days left, evidence completion status etc\n - The list is sorted by default by the number of days left with the portfolio (ascending)\n\nPortfolios - Other features\n - RTO User has got filtering options based on the completion status of the portfolio (current or completed)\n - Search will perform a portfolio search based on the candidate name, qualification name\n\nPlease refer to PORTFOLIO page/tab (see REQ33)\n\n\n\n\n35\n\nPortfolios Details - Detailed view\n - RTO  will be able to see the recent notes on that porfolio in this page\n -  RTO can make a note on the porfolio after any action is performed.\n - RTO can also initiate a message conversation with the facilitator from this screen. \n - Every conversation should be tagged with a portfolio. This relation will be used to fetch all the conversation with respect to a portfolio\n\n\n\n\n\n\n37\n\nReview the portfolio of the applicants. (Review the documents, videos, pictures etc.)\nPortfolios Details - Review Process\n - Each unit will be tagged to represent whether the assessor have made it ''competent'' \n - RTO will be able to view the evidences and self assessment submitted by the candidate\n- All the media files should be streamed from the server, where as the documents, pdfs should be opened from the browser ( if supported) otherwise it should get downloaded into the computer and then ready for the review\n\n\n\n\n\n\n38\n\nApprove/disapprove portfolio\nPortfolios Details - Approval process\n - RTO can view and approve (Competent) the evidence from the ''detailed view'' after reviewing the evidences for all units\n\nPlease refer to PORTFOLIO - DETAILED page/tab (see REQ35)\n\n\n\n\n39\n\nPortfolios Details - Issue Qualification\n - When RTO completes assessment, they can issue the qualification or send it back.\n - Both will trigger a message to the Facilitator and its Facilitator job to  let the candidate know about the outcome of the process.\n - If the outcome is ''Issue Qualification'', portfolio will be closed and candidate will be receiving the certificate (offline  process)\n\n\n\n\n', 1),
