(291, ' 	\nEnvironmental requirementsare identified for the project in accordance with environmental plans and statutory and regulatory authority obligations, and are applied.\n\n2\n\nIdentify and select hand, power and pneumatic tools.\n\n2.1\n\nHand, power and pneumatic tools, their functions, operations and limitations are identified and selected.\n\n2.2\n\nOHS requirements for using hand, power and pneumatic tools are recognised and adhered to.\n\n2.3\n\nLubricants, hydraulic fluid and water are checked according to manufacturer recommendations.\n\n3\n\nUse tools.\n\n3.1\n\nHand tools used are appropriate to the task and materials and are in accordance with OHS requirements.\n\n3.2\n\nPower and pneumatic tools are safely ', 1),
(292, '"1. Open the URL <Application URL> using browser.\n2. Login to the Application.\n3. Click on portfolios header navigation tab.\n4. Click on particular portfolio. Check whether it is navigated to particular portfolio or not.\n5. Qualifications page should be the default page when Clicked on Particular portfolio.\n6. Click on Particular unit and check whether the satisfactory and not yet satisfactory buttons are clicked.   "\n"1. Open the URL <Application URL> using browser.\n2. Login to the Application.\n3. Click on portfolios header navigation tab.\n4. Click on particular portfolio. Check whether it is navigated to particular portfolio or not.\n5. Qualifications page should be the default page when Clicked on Particular portfolio.\n6. Click on Particular unit and click on the Satisfactory option. If the evidence provided is related to that document."\n"1. Open the URL <Application URL> using browser.\n2. Login to the Application.\n3. Click on portfolios header navigation tab.\n4. Click on particular portfolio. Check whether it is navigated to particular portfolio or not.\n5. Qualifications page should be the default page when Clicked on Particular portfolio.\n6. Click on Particular unit and click on the Not yet Satisfactory button. If the evidence provided is not related to that document."', 1),
(294, ' Verify that facilitator can be able to see the Qualification page which contains Core Units, Elective Units, Evidences submitted percentage, Days remaining to review,  Details of the facilitator,assessor and rto for the particular course and submit to assessor button.\nVerify that facilitator can be able to click on the picture which is beside details of the facilitator,assessor and rto for the particular course.\nVerify that text can be added to message text box when facilitator clicks on message text box in new message module.\nVerify that an error should appear as “please enter the email address” when the “To” text box is empty.\nVerify that a message is sent when facilitator clicks on the send button in the message pop up.\nVerify that message module closes when facilitator clicks on the “X” option.\nVerify that a message appears as “Message sent successfully when facilitator clicks on the send button in the message pop up.\nVerify that facilitator can add the notes by clicking on the note option. which is below the core units and Elective units.\nVerify that facilitator can add the note along with the date to “To Do list” by clicking on to do list which is below the core units and Elective units.\nVerify that evidences or messages or portfolios can be added to “To Do list” when facilitator clicks on to do list which is below the core units and Elective units.\nVerify that facilitator can click on the particular unit and check the evidences in the qualification.', 1),
(299, ' "1. Open the URL <Application URL> using browser\n2. Login to the account. \n3. Click on signup using link."\n"1. Open the URL <Application URL> using browser.\n2. Login to the application.\n3. The dash board page is the default page.\n4. Check whether the dashboard page contains : GQ Australia logo In the left top, Dash board, Portfolios, Messages and profile header navigation tabs in right top."\n"1. Open the URL <Application URL> using browser.\n2. Login to the Application.\n3. The dashboard head navigation tab should be highlighted when the assessor has logged in to the account. dashboard page should be default page once the assessor logs in."\n"1. Open the URL <Application URL> using browser.\n2. Login to the Application.\n3. The dashboard page is the default page and dashboard option should  be highlighted.\n4. Check whether to do list, messages, portfolios and evidences are available in the dashboard page."\n"1. Open the URL <Application URL> using browser.\n2. Login to the Application.\n3. The dashboard page is the default page and dashboard option should  be highlighted.\n4. Check whether assessor can be able to click on the check boxes in the to do list." \n!@#$%^&*()\n\n12345678909876543213456789098765432123456789098765432123456789876543212345678909876543212345678909876543234567890987654321234567890-09876543212345678909876543212345678', 1),
