(392, ' "1. Open the URL <Application URL> using browser.\n2. Login to the Application.\n3. The dashboard page is the default page and dashboard option should  be highlighted.\n4. Check whether assessor can click on the message in the to do list."\n"1. Open the URL <Application URL> using browser.\n2. Login to the Application.\n3. The dashboard page is the default page and dashboard option should  be highlighted.\n4. Check whether assessor can click on the evidence in the to do list. "\n"1. Open the URL <Application URL> using browser.\n2. Login to the Application.\n3. The dashboard page is the default page and dashboard option should  be highlighted.\n4. Click on message in the “To do today”. In the to do list. Then the page should  be navigated to Messages page."\n"1. Open the URL <Application URL> using browser.\n2. Login to the Application.\n3. The dashboard page is the default page and dashboard option should  be highlighted.\n4. Click on evidences in the “To do today”. In the to do list. Then the page should  be navigated to Evidence page."\n"1. Open the URL <Application URL> using browser.\n2. Login to the Application.\n3. The dashboard page is the default page and dashboard option should  be highlighted\n4. Click on check box option which is beside the message or profile or Evidence.\n5. Check whether assessor can click on ok button to move the message or profile or Evidence in the to do list. To completed today."\n"1. Open the URL <Application URL> using browser.\n2. Login to the Application.\n3. The dashboard page is the default page and dashboard option should  be highlighted\n4. Click on check box option which is beside the message or profile or Evidence.\n5. Click on ok button in the to do list pop up to move the message or profile or Evidence in the to do list. To completed today."\n"1. Open the URL <Application URL> using browser.\n2. Login to the Application.\n3. The dashboard page is the default page and dashboard option should  be highlighted\n4. Click on check box option which is beside the message or profile or Evidence.\n5. Click on ok button in the to do list pop up to move the message or profile or Evidence in the to do list. To completed today.\n6. Check whether the message appears as “moved to completed today successfully”."\n"1. Open the URL <Application URL> using browser.\n2. Login to the Application.\n3. The dashboard page is the default page and dashboard option should  be highlighted.\n4. Check whether assessor can click on add new “Message, Portfolio, Evidence and Note” to add new message, portfolio, evidence and note."\n"1. Open the URL <Application URL> using browser.\n2. Login to the Application.\n3. The dashboard page is the default page and dashboard option should  be highlighted.\n4. Click on Add New portfolio to add portfolio to “To Do List”. Then in the message option a drop down will appear in the “Portfolio” option which is in the right side below “Messages” option in the dashboard. \n5. Click on “+”option to add the particular portfolio which assessor would like to add to the “To Do List”."', 1),
