(469, 'Religion, Emerson says, could benefit from a good dose of self-reliance because self-reliance turns a person''s mind from petty, self-centered desires to a benevolent wish for the common good. Religion''s main problem is its fear of individual creativity. As a consequence, it opts for the art of mimicry: "Everywhere I am hindered of meeting God in my brother, because he has shut his own temple doors, and recites fables merely of his brother''s, or his brother''s brother''s God." Any religion can introduce new ideas and systems of thought to an individual, but religious creeds are dangerous because they substitute a set of ready answers for the independent thought required of the self-reliant person.', 1),
(471, 'Each paragraph must be related to the provided topic. I do not expect you to be an expert on any of these. A quick search should reveal enough to write a couple of sentences about the topic.\n\nWhile this is not a rushed project, please adhere to the time frame within your bid. The winner will not be chosen based on the speed in which the project can be completed, so please try to estimate the time you need accurately.', 1),
