(1172, 'Because  Because ,,,.Because  Because Because  The Himalayan range is home to the planet''s highest peaks, including the highest, Mount Everest. The Himalayas include over a hundred mountains exceeding 7,200 metres (23,600 ft) in elevation. By contrast, the highest peak outside Asia – Aconcagua, in the Andes – is 6,961 metres (22,838 ft) tall.[1]. \n\nThe Himalayas are spread across five countries: Bhutan, India, Nepal, People''s Republic of China, and Pakistan, with the first three countries having sovereignty over most of the range.[2] The Himalayan range is bordered on the northwest by the Karakoram and Hindu Kush ranges, on the north by the Tibetan Plateau, and on the south by the Indo-Gangetic Plain. Some of the world''s major rivers, the Indus, the Ganges, and the Tsangpo-Brahmaputra, rise in the Himalayas, and their combined drainage basin is home to some 600 million people. The Himalayas have profoundly shaped the cultures of South Asia; many Himalayan peaks are sacred in Hinduism and Buddhism.\n\nLifted by the subduction of the Indian tectonic plate under the Eurasian Plate, the Himalayan range runs, west-northwest to east-southeast, in an arc 2,400 kilometres (1,500 mi) long. Its western anchor, Nanga Parbat, lies just south of the northernmost bend of Indus river, its eastern anchor, Namcha Barwa, just west of the great bend of the Tsangpo river. The range varies in width from 400 kilometres (250 mi) in the west to 150 kilometres (93 mi) in the east.', 1),
