(92, 35, 37, 'Re: 9/9 8:20AM', 'Sustain your career\r\nIf you have experience in integrating work systems to improve the operational functions of a business, including employee performance, cost reduction and staff morale, then recognising your experience via RPL is a convenient and valuable way to earn accreditation for your efforts, and assist future opportunities in team leadership, supervision, project management, and operational specialisation. Get Qualified Australia currently offers the following qualifications within the Sustainability training package at the Advanced Diploma, Diploma, and Certificate II, III and IV levels.\r\n\r\nRaise your benchmarks with a Graduate Certificate in Competitive Systems and Practices.\r\nIf you''ve been working in the field of Competitive Systems and Practices, setting standards and developing models to refine and improve systems, analyse, map, and manage a value stream, and optimise the costs of products and services, those skills may have already qualified you for formal recognition.\r\n\r\nFollowing a dynamic path to become certified, improve employment options, or to join the lean principles of Competitive Systems and Practices, pitch in your skills in managing 5S systems, designing experiments, and applying the theory of constraints.\r\n\r\nDeploy sustainable practices in Competitive Systems and Practices and watch your leadership soar.\r\n\r\nSee if you’re eligible today with our Free Skills Review.', '2016-09-09 04:44:05', 1, 0, 0, 0, 88, 0),
