(816, 69, 60, 'content is large just view it ', 'The Himalayas, or Himalaya, (/?h?m??le?.?/ or /h??m??l?j?/) are a mountain range in Asia separating the plains of the Indian subcontinent from the Tibetan Plateau.\r\n\r\nThe Himalayan range is home to the planet''s highest peaks, including the highest, Mount Everest. The Himalayas include over a hundred mountains exceeding 7,200 metres (23,600 ft) in elevation. By contrast, the highest peak outside Asia – Aconcagua, in the Andes – is 6,961 metres (22,838 ft) tall.[1]\r\n\r\nThe Himalayas are spread across five countries: Bhutan, India, Nepal, People''s Republic of China, and Pakistan, with the first three countries having sovereignty over most of the range.[2] The Himalayan range is bordered on the northwest by the Karakoram and Hindu Kush ranges, on the north by the Tibetan Plateau, and on the south by the Indo-Gangetic Plain. Some of the world''s major rivers, the Indus, the Ganges, and the Tsangpo-Brahmaputra, rise in the Himalayas, and their combined drainage basin is home to some 600 million people. The Himalayas have profoundly shaped the cultures of South Asia; many Himalayan peaks are sacred in Hinduism and Buddhism.\r\n\r\nLifted by the subduction of the Indian tectonic plate under the Eurasian Plate, the Himalayan range runs, west-northwest to east-southeast, in an arc 2,400 kilometres (1,500 mi) long. Its western anchor, Nanga Parbat, lies just south of the northernmost bend of Indus river, its eastern anchor, Namcha Barwa, just west of the great bend of the Tsangpo river. The range varies in width from 400 kilometres (250 mi) in the west to 150 kilometres (93 mi) in the east.\r\nMount Machapuchare (Mount Fishtail) seen from Chomrong, Kaski, Nepal. Elevation: 6,993 m (22,943 ft), prominence: 1,233 m (4,045 ft).\r\n\r\nContents\r\n\r\n    1 Name\r\n    2 Ecology\r\n    3 Geology\r\n    4 Hydrology\r\n        4.1 Lakes\r\n    5 Impact on climate\r\n    6 Religions of the region\r\n    7 Resources\r\n    8 Culture\r\n    9 See also\r\n    10 References\r\n    11 Further reading\r\n    12 External links\r\n\r\nName\r\n\r\nThe name of the range derives from the Sanskrit Him?-laya (??????, "Abode of Snow"), from himá (???, "cold, winter, frost") and ?-laya (???, "receptacle, dwelling").[3] They are now known as the "Himalaya Mountains", usually shortened to the "Himalayas". Formerly, they were described in the singular as the "Himalaya". This was also previously transcribed "Himmaleh", as in Emily Dickenson''s poetry[4] and Henry David Thoreau''s essays.[5]\r\n\r\nFrom the same name, they are known as the Him?laya in Nepali and Him?lay in Hindi (both written ??????), the Himalaya (????????) in Tibetan, t', '2016-09-14 12:13:51', 1, 0, 0, 0, 0, 0),
